pragma solidity ^0.4.24;

contract Medical {

    address private owner;

    struct Doctor {
        string name;
        string password;
        string idCard;
        address createdBy;

    }

    struct Patient {
        string name;
        string password;
        string curp;
        string birthday;
        string blood;
        address createdBy;
        Diagnosis[] history;
    }

    struct Diagnosis {
        string id;  // address doctor + address patient + creationDate
        string creationDate;
        string weight;
        string height;
        string description;
        string observations;
        address createdBy;
		string hashFile;
    }

    // Relations
	mapping(address => Doctor) private doctors;
	mapping(address => Patient) private patients;

	mapping (address => bool) private registeredPatients;  // Patients registered
	mapping (address => bool) private registeredDoctors;  // Doctors registered

	address[] public listTotalDoctors;  // The list of registered doctors
	address[] public listTotalPatients; // The list of registered patients


    constructor() public {
		owner = msg.sender;
		// Doctor storage doctor = doctors[msg.sender];  // get and save doctor
		// doctor.name = "Genesis";
		// registeredDoctors[msg.sender] = true;
	}

    // register Doctors
	function registerDoctor(address doctorAddress, string name, string idCard, string password) public {
	    // require(doctorIsRegistered(msg.sender), "The registering Doctor is not registered");  // the doctor is registered
		require(!doctorIsRegistered(doctorAddress), "The Doctor is already registered");  // the new doctor is not already registered
		Doctor storage doctor = doctors[doctorAddress];  // get and save doctor
		doctor.name = name;
		doctor.idCard = idCard;
		doctor.createdBy = msg.sender;
		doctor.password = password;
		registeredDoctors[doctorAddress] = true;  // save the senders address
		listTotalDoctors.push(doctorAddress);
	}

	// register Patients
	function registerPatient(address patientAddress, string name, string curp, string birthday, string blood, string password) public {
	    require(doctorIsRegistered(msg.sender), "The registering Doctor is not registered");  // the doctor is registered
		require(!patientIsRegistered(patientAddress), "The Patient is already registered");  // the new patient is not already registered
		Patient storage patient = patients[patientAddress];  // get and save patient
		patient.name = name;
		patient.curp = curp;
		patient.createdBy = msg.sender;
		patient.password = password;
		patient.blood = blood;
		patient.birthday = birthday;
		registeredPatients[patientAddress] = true;  // save the senders address
		listTotalPatients.push(patientAddress);
	}

	// login Doctors
	function loginDoctor(address addr, string password) public view returns (string, string) { 
		require(doctorIsRegistered(addr), "Doctor is not registered");  // check if the user is registered
		Doctor memory doctor = doctors[addr];
		require(checkPassword(password, doctor.password), "Invalid password");
		return (doctor.name, doctor.idCard);
	}

	// login Patients
	function loginPatient(address addr, string password) public view returns (string, string) {  
		// require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(addr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[addr];
		require(checkPassword(password, patient.password), "Invalid password");
		return (patient.name, patient.curp);
	}

	// get Patient data from address
	function getPatient(address patientAddress) public view returns (string) {  
		require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddress), "Patient is not registered");  // check if the user is registered
		Patient memory p = patients[patientAddress];
		string memory response = string(abi.encodePacked(addressToString(patientAddress), ",", p.name, ",", p.curp, ",", p.birthday));
		response = string(abi.encodePacked(response, ",", p.blood, ",", addressToString(p.createdBy)));
    	return response;
	}

	// get Doctor data from address
	function getDoctor(address doctorAddress) public view returns (string) {  
		require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(doctorIsRegistered(doctorAddress), "Doctor is not registered");  // check if the user is registered
		Doctor memory d = doctors[doctorAddress];
    	string memory response = string(abi.encodePacked(addressToString(doctorAddress), ",", d.name, ",", d.idCard, ",", addressToString(d.createdBy)));
    	return response;
	}

    // check if the doctor address is already registered
	function doctorIsRegistered(address addr) private view returns (bool) {
		return registeredDoctors[addr];
	}

    // check if the patient address is already registered
	function patientIsRegistered(address addr) private view returns (bool) {
		return registeredPatients[addr];
	}

	// check password match
	function checkPassword(string password, string realPassword) internal pure returns (bool) {
	    if (keccak256(abi.encodePacked(password)) == keccak256(abi.encodePacked(realPassword))) {
	        return true;
        }
	}

	// add Diagnosis to History of Patient
	function addDiagnosisToPatient(address patientAddress, string creationDate, string weight, 
	    string height, string description, string observations, string hashFile) public returns(string) {

	    require(doctorIsRegistered(msg.sender), "The registering Doctor is not registered");  // the doctor is registered
		require(patientIsRegistered(patientAddress), "The Patient is not registered");  // the new patient is not already registered
		Patient storage patient = patients[patientAddress];  // get and save doctor

		// d is the new Diagnosis
		Diagnosis memory d;
		d.id = uint2hexstr(getUniqueId(patientAddress));
		d.creationDate = creationDate;
		d.weight = weight;
		d.height = height;
		d.description = description;
		d.observations = observations;
		d.createdBy = msg.sender;
		d.hashFile = hashFile;

		// push the Diagnosis to history
		patient.history.push(d);
	}

	// get History IDs by the patient address
	function getHistoryPatientByAddress(address patientAddr) public view returns (string) {  
		require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[patientAddr];

		string memory historyIds;
        historyIds = patient.history[0].id;
        for (uint i = 1; i < patient.history.length; i++) {
            historyIds = string(abi.encodePacked(historyIds, ",", patient.history[i].id));
        }


		return historyIds;
	}

	// get Diagnosis from ID and patient address
	function getDiagnosisByIdAndAddress(string idDiagnosis, address patientAddr) public view returns (string) {  
		require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[patientAddr];

		// TODO
		// Diagnosis memory d = patient.history[id];
		Diagnosis memory d;
		bool founded = false;
		for (uint i = 0; i < patient.history.length; i++) {
		    if (keccak256(abi.encodePacked(patient.history[i].id)) == keccak256(abi.encodePacked(idDiagnosis))) {
		        d = patient.history[i];
		        founded = true;
		        break;
		    }
		}

		if (!founded) {
		    return "Error, Diagnosis not found";
		} else {
    		string memory response = string(abi.encodePacked(d.creationDate, ",", d.weight, ",", d.height, ",", d.description));
			response = string(abi.encodePacked(response,",", d.observations, ",", addressToString(d.createdBy), ",", d.hashFile));

    		return response;
		}
	}

	function listDoctors(address docAddress) public view returns (address[] memory) {
	    require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		return listTotalDoctors;
		// string memory res = addressToString(listTotalDoctors[0]);
		// for (uint i = 1; i < listTotalDoctors.length; i++) {
		// 	res = string(abi.encodePacked(res, ",", addressToString(listTotalDoctors[i])));
		// }
		// return res;
	}

	function listPatients(address docAddress) public view returns (address[] memory) {
	    require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		return listTotalPatients;
		// string memory res = addressToString(listTotalPatients[0]);
		// for (uint i = 1; i < listTotalPatients.length; i++) {
		// 	res = string(abi.encodePacked(res, ",", addressToString(listTotalPatients[i])));
		// }
		// return res;
	}

	// Generate unique ID
    function getUniqueId(address patientAddress) internal view returns (uint) {
        // hash the msg.sender + patientAddress + date now
        bytes20 b = bytes20(keccak256(abi.encodePacked(msg.sender, patientAddress, now)));  
        uint id = 0;
        for (uint index = b.length-1; index+1 > 0; index--) {
            id += uint(b[index]) * ( 16 ** ((b.length - index - 1) * 2));
        }

        return id;
    }

    // uint to string
    function uint2hexstr(uint i) internal pure returns (string) {
        if (i == 0) return "0";
        uint j = i;
        uint length;
        while (j != 0) {
            length++;
            j = j >> 4;
        }
        uint mask = 15;
        bytes memory bstr = new bytes(length);
        uint k = length - 1;
        while (i != 0){
            uint curr = (i & mask);
            bstr[k--] = curr > 9 ? byte(55 + curr ) : byte(48 + curr); // 55 = 65 - 10
            i = i >> 4;
        }
        return string(bstr);
    }

    // Address to string
    function addressToString(address _addr) internal pure returns(string) {
        bytes32 value = bytes32(uint256(_addr));
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint i = 0; i < 20; i++) {
            str[2+i*2] = alphabet[uint(uint8(value[i + 12] >> 4))];
            str[3+i*2] = alphabet[uint(uint8(value[i + 12] & 0x0f))];
        }
        return string(str);
    }

	function uint2str(uint i) internal pure returns (string){
		if (i == 0) return "0";
		uint j = i;
		uint length;
		while (j != 0){
			length++;
			j /= 10;
		}
		bytes memory bstr = new bytes(length);
		uint k = length - 1;
		while (i != 0){
			bstr[k--] = byte(48 + i % 10);
			i /= 10;
		}
		return string(bstr);
	}


}
